import Card from "../../UI/Card/Card";
import classes from './ServicesItem.module.css'
import ServiceFieldItem from "./ServiceFieldItem";

function ServicesList(props){
    return(
        <ul>
            {props.services.map((service) => <ServiceFieldItem
            tite={service.title}
            list={service.list}
            />)
            }
        </ul>
    );
}

export default ServicesList;
